def main(filename, **kwargs):
    if not filename or filename == '-':
        text = sys.stdin.read()
    else:
        with open(filename) as f:
            text = f.read()
    parser = ExpressionParser()
    return parser.parse(
        text,
        filename=filename,
        **kwargs
    )


